// Score.js

import React, { Component } from 'react';
import './quiz.css'

class Score extends Component {
    render() {
        const { score, onNextQuestion } = this.props;

        return (
            <div>
                <h2>Results</h2>
                <h4>Your score: {score}</h4>
            </div>
        );
    }
}

export default Score;
